import './Navbar.scss';
import React from 'react';

export default function Navbar() {
    return (
        <div className='navbar'>
            <div className='head'>
                <h1>An<span>Qi.</span></h1>
            </div>
            
            <div className='links'>
                <a className='nav project' href='#projects'>Project</a>
                <a className='nav' href='#about'>About</a>
                <a className='nav' href='/'>Resume</a>
            </div>
        </div>
    );
}
